matrix mul(matrix a,matrix b)
{
	matrix ans;
    memset(ans.s,0,sizeof(ans.s));
	for(int k=0;k<=4;k++)
	for(int i=0;i<=4;i++)
	for(int j=0;j<=4;j++)
