#include <string.h>

int parseHex(const char h[]){
	int n=strlen(h);
	int x=1;
	int ans=0;
	for (int i = n-1; i >=0 ; -- i){
		if(h[i]<='9'&&h[i]>='0'){
			ans+=(h[i]-'0')*x;
		}
		else{
			ans+=(h[i]+10-'A')*x;
		}
		x*=16;
	}
	return ans;
}

