			hex[i-1]=add-10+'A';
		}
		x/=16;
	}
}

void decToBin(const char dec[], char bin[]){
	int i=0,x=0;
	for (int i = 0; i <100 ; ++ i) {
		bin[i]=0;
	}
	while(dec[i]!='\0'){
		x=x*10+dec[i]-'0';
		i++;
	}
	i=0;
	int j=x,add;
	while(j>0){
		j/=2;
		i++;
	}
	for(i;i>=1;i--){
		add=x%2;
		bin[i-1]=add+'0';
		x/=2;
	}
}

