void get_ints(char line[],char * ints[])
{
	int len=0;
	while (line[len]!='\0')
	{
		if(line[len]<'0'||line[len]>'9')line[len]='\0';
		len++;
	}
	int cnt=0;	
	for(int i=0;i<len;i++)
	{
		if(('0'<=line[i]&&line[i]<='9')&&(i==0||(line[i-1]<'0'||line[i-1]>'9')))
		ints[cnt++]=&line[i];
	}
	ints[cnt]=0;
}

int get_int(char s[],char t[])
{
	int len=0;while (s[len]!='\0')len++;
	int len_=0;while (t[len_]!='\0')len_++;
	for(int i=0;i+len_-1<len;i++)
	{
		int flag=1; 
		for(int j=0;j<len_;j++)if(s[i+j]!=t[j])flag=0;
		if(!flag)continue;

		int k=i,ans=0;
		while('0'>s[k]||s[k]>'9')k++;
		while('0'<=s[k]&&s[k]<='9')ans=ans*10+s[k]-'0',k++;		
		return ans;
	}
}

int cmp(char *a,char *b)
{	
	int x=0;	
	while(a[x]==b[x])x++;
	return a[x]>=b[x]; 
}
