#include<string.h>
#define N 110
#define max(a,b) (a>b?a:b)
int dp[N][N],fg[N][N];
struct Result LCS(char *s1,char *s2)
{
	int n=strlen(s1),m=strlen(s2);	
	for(int i=n;i>=1;i--)s1[i]=s1[i-1];
	for(int i=m;i>=1;i--)s2[i]=s2[i-1];

	for(int i=1;i<=n;i++)
	for(int j=1;j<=m;j++)
	{
		dp[i][j]=max(dp[i][j-1],dp[i-1][j]);
		if(s1[i]==s2[j])dp[i][j]=max(dp[i][j],dp[i-1][j-1]+1);
	}

	fg[n][m]=1;
	for(int i=n;i>=0;i--)
	for(int j=m;j>=0;j--)
	if(fg[i][j])
	{
		if(i&&dp[i][j]==dp[i-1][j])fg[i-1][j]=1;
		if(j&&dp[i][j]==dp[i][j-1])fg[i][j-1]=1;
		if(i&&j&&s1[i]==s2[j]&&dp[i][j]==dp[i-1][j-1]+1)fg[i-1][j-1]=1;
	}

	struct Result res;
	for(int i=0;i<100;i++)res.LCS[i]=0;	
	int x=0,y=0,t=0;
	while(x!=n||y!=m)
	{
		if(s1[x+1]==s2[y+1]&&fg[x+1][y+1]){x++;y++;res.LCS[t++]=s1[x];continue;}
		if(fg[x][y+1]){y++;continue;}
		if(fg[x+1][y]){x++;continue;}
	}
	return res;
}

#define min(a,b) (a<b?a:b)
int dp[110][110];
int getMultiplications(int n,int a[])
{

	for(int i=0;i<=n+1;i++)for(int j=0;j<=n+1;j++)if(i!=j)dp[i][j]=1e9+7;

	for(int l=n;l>=1;l--)
	for(int r=l+1;r<=n;r++)
	{
		for(int k=l;k<r;k++)
		dp[l][r]=min(dp[l][r],dp[l][k]+dp[k+1][r]+a[l-1]*a[k]*a[r]);
	}
	return dp[1][n];
}

